import React, { useState } from "react";
import { Link } from "react-router-dom";

const INITIAL_DATA = {
  name:"",
  email:"",
  password:""
}

const RegisterPage = () => {
  const [user, setUser] = useState(INITIAL_DATA);

  const onSubmitHandeler = (e)=>{
    e.preventDefault()
    console.log(user);
  }

  const handleChange = (e)=>{
    
    setUser({...user,[e.target.name]:e.target})
  }

  return (
    <div className="loginForm-container">
      <span id="formTitle">Register</span>
      <form  className="loginForm" onSubmit={(e)=>onSubmitHandeler(e)}>
        <input
          type="text"
          name="name"
          className="loginInput"
          onChange={handleChange}
          placeholder="Enter name "
        />
        <input
          type="email"
          name="email"
          className="loginInput"
          onChange={handleChange}
          placeholder="Enter email "
        />
        <input
          type="password"
          name="password"
          className="loginInput"
          onChange={handleChange}
          placeholder="Enter password "
        />
        <button className="loginInput" id="login-btn" type="submit">
          Register
        </button>
      </form>
      <p>
        Aldready have an account?<Link to={"/login"}> Login</Link>
      </p>
    </div>
  );
};

export default RegisterPage;
